import { GET_ALL_PRODUCTS_SUCCESS } from '../actions/product/product.types'

export default productReducer = (state, action) => {
  switch (action.type) {
    case GET_ALL_PRODUCTS_SUCCESS:
      return {
        ...state,
        products: action.payload.products,
      }
    default:
      return state
  }
}
